import React from 'react';
import styled from 'styled-components';

export const StickyDiv=styled.div`
position:fixed;
width:100%;
z-index:999;
background-color:#f8f8f8;
padding:40px 0 30px 0; 
align-items:baseline;
`;

export const PositionRelative=styled.div`
position:relative;
display:flex;
flex:wrap;
padding:15% 0 0 0;
`;
